import React,{Component} from 'react'
import {getLogo} from './model.js'
import './index.scss'
import {connect} from 'react-redux'


class Trademark extends Component {
	constructor(props) {
	  super(props);
	  this.state = {
	  	womenlogo:[],
	  	isShow:false,
	  	menLogo:[],
	  	beautyLogo:[],
	  	homeLogo:[],
	  	kidsLogo:[],
	  	kids:{},
	  	home:{},
	  	beauty:{},
	  	women:{},
	  	men:{}
	  };
	}
	render(){
		return <div id="trademark">
			<header>
				<a href="/#/index" className="left"><span className="iconfont">&#xe61e;</span></a>
				<span className="center">品牌活动</span>
				<a className="right" onClick={this.handleShow.bind(this)}>
					<span className="iconfont">&#xe678;</span>
					{
						this.state.isShow?
						<span className="three"></span>
						:null
					}
				</a>

				{
					this.state.isShow?
					<ul>
						<li><a href="#">首页</a></li>
						<li><a href="#">购物袋</a></li>
						<li><a href="#" className="bu">个人中心</a></li>
					</ul>
					:null
				}
			</header>
			<div className="banner">
				<img src="data:image/png;base64," alt="图片出不来了"/>
			</div>

			<div className="content">
				<img src="http://www.mei.com/static/img/brand-women.d3720cb.jpg" alt="图片去出来啦" className="big"/>
				<ul>
				{
					this.state.womenlogo.map(item=>
						<li key={item.logoId}>
							<img src={item.logoUrl} alt="提交代码"/>
						</li>
					)
				}
				<li>
					<img src="data:image/png;base64," alt="图片出不来了" onClick={this.handleDetail.bind(this,this.state.women.siloId)}/>
				</li>
				</ul>
			</div>

			<div className="content">
				<img src="http://www.mei.com/static/img/brand-men.9fcff1e.jpg" alt="图片去出来啦" className="big"/>
				<ul>
				{
					this.state.menLogo.map(item=>
						<li key={item.logoId}>
							<img src={item.logoUrl} alt="提交代码"/>
						</li>
					)
				}
				<li>
					<img src="data:image/png;base64," alt="图片出不来了" onClick={this.handleDetail.bind(this,this.state.men.siloId)}/>
				</li>
				</ul>
			</div>

			<div className="content">
				<img src="http://www.mei.com/static/img/brand-beauty.39c7427.jpg" alt="图片去出来啦" className="big"/>
				<ul>
				{
					this.state.beautyLogo.map(item=>
						<li key={item.logoId}>
							<img src={item.logoUrl} alt="提交代码"/>
						</li>
					)
				}
				<li>
					<img src="data:image/png;base64," alt="图片出不来了" onClick={this.handleDetail.bind(this,this.state.beauty.siloId)}/>
				</li>
				</ul>
			</div>

			<div className="content">
				<img src="http://www.mei.com/static/img/brand-home.b67b598.jpg" alt="图片去出来啦" className="big"/>
				<ul>
				{
					this.state.homeLogo.map(item=>
						<li key={item.logoId}>
							<img src={item.logoUrl} alt="提交代码"/>
						</li>
					)
				}
				{
					<li>
						<img src="data:image/png;base64," alt="图片出不来了" onClick={this.handleDetail.bind(this,this.state.home.siloId)}/>
					</li>
				}
				</ul>
			</div>

			<div className="content">
				<img src="http://www.mei.com/static/img/brand-kids.6540fe3.jpg" alt="图片去出来啦" className="big"/>
				<ul>
				{
					this.state.kidsLogo.map(item=>
						<li key={item.logoId}>
							<img src={item.logoUrl} alt="提交代码"/>
						</li>
					)
				}
				{
					<li>
						<img src="data:image/png;base64," alt="图片出不来了" onClick={this.handleDetail.bind(this,this.state.kids.siloId)}/>
					</li>
				}
				</ul>
			</div>
		</div>
	}

	componentDidMount(){
		getLogo().then(res=>
			this.setState({
				womenlogo:res.data.body.womenLogo.brandLogo.slice(0,8),
				women:res.data.body.womenLogo,
				menLogo:res.data.body.menLogo.brandLogo.slice(0,5),
				men:res.data.body.menLogo,
				beautyLogo:res.data.body.beautyLogo.brandLogo.slice(0,5),
				beauty:res.data.body.beautyLogo,
				homeLogo:res.data.body.homeLogo.brandLogo.slice(0,5),
				home:res.data.body.homeLogo,
				kidsLogo:res.data.body.kidsLogo.brandLogo.slice(0,5),
				kids:res.data.body.kidsLogo
			})
		)
		this.props.hide();
	}
	componentWillUnmount(){
		this.props.show();
	}
	handleShow(){
		this.setState({
			isShow:!this.state.isShow
		})
	}
	handleDetail(id){
		this.props.history.push(`/detailName/${id}`)
	}
}

export default connect(
  null,
  {
  hide(){
      return {
        type:"Hideheader", 
		payload:false 
      }
    },
  show(){
      return {
        type:"Showheader", 
		payload:true 
      }
    }
  }
)(Trademark)
